function parseCsvRecords(text){
  if(!text) return [];
  var lines=text.trim().split("\n");
  if(lines.length<=1) return [];
  var headers=lines[0].split(",").map(function(header){return header.trim();});
  var records=[];
  for(var lineIndex=1; lineIndex<lines.length; lineIndex++){
    var line=lines[lineIndex].trim();
    if(!line) continue;
    var values=line.split(",");
    var record={};
    for(var idx=0; idx<headers.length; idx++){
      var key=headers[idx];
      var value=values[idx]?values[idx].trim():"";
      record[key]=value;
    }
    if(typeof record.hasSleeve==="string"){
      record.hasSleeve=record.hasSleeve.toLowerCase()==="true";
    }
    if(record.cover) record.cover=record.cover.replace("http://","https://");
    records.push(record);
  }
  return records;
}


